<html>

<head>
    <style>
        body {
            overflow-y: hidden;
            background-color: #0b0f19;
            color: #eeeeee;
        }

        /* The switch - the box around the slider */
        .switch {
            position: relative;
            display: inline-block;
            width: 60px;
            height: 34px;
        }

        /* Hide default HTML checkbox */
        .switch input {
            opacity: 0;
            width: 0;
            height: 0;
        }

        /* The slider */
        .slider {
            position: absolute;
            cursor: pointer;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-color: #ccc;
            -webkit-transition: 0.4s;
            transition: 0.4s;
        }

        .slider:before {
            position: absolute;
            content: "";
            height: 26px;
            width: 26px;
            left: 4px;
            bottom: 4px;
            background-color: white;
            -webkit-transition: 0.4s;
            transition: 0.4s;
        }

        input:checked+.slider {
            background-color: #2196f3;
        }

        input:focus+.slider {
            box-shadow: 0 0 1px #2196f3;
        }

        input:checked+.slider:before {
            -webkit-transform: translateX(26px);
            -ms-transform: translateX(26px);
            transform: translateX(26px);
        }

        /* Rounded sliders */
        .slider.round {
            border-radius: 34px;
        }

        .slider.round:before {
            border-radius: 50%;
        }

        /* From ChatGPT */
        .container {
            display: flex;
        }

        .image-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            /* Each image has a width of 200px */
            gap: 10px;
            /* Adjust the gap between images as needed */
        }

        .image-grid img {
            width: 100%;
            /* Make sure each image fills its grid cell */
            height: auto;
            /* Maintain the aspect ratio of the images */
            cursor: pointer;
            /* Set the cursor to a hand when hovering over an image */
            min-height: 120px;
        }

        .column-headers {
            white-space: nowrap;
            margin-bottom: 4px;
            margin-top: 0px;
            text-align: center;
        }

        .left-column {
            width: 15vw;
        }

        #characters,
        #tags {
            list-style: none;
            margin-top: 0px;
            border-radius: 1px;
            border: #374151;
            border-style: solid;
            padding: 2px;
            height: 40vh;
            overflow: auto;
        }

        .searchBar {
            width: 100%;
        }

        .searchLabel {
            display: flex;
        }

        .andOrDiv {
            display: flex;
            align-items: center;
            justify-content: space-around;
        }

        .andOrButtonLabel {
            padding: 0px 10px;
            font-size: large;
            font-weight: bold;
        }


        .topMainBrowser {
            width: 100%;
            height: 99vh;
            display: flex;
            flex-flow: column;
            margin-left: 5px;
            margin-right: 10px;
        }

        .main-div {
            padding: 5px;
            width: 100%;
            /* height: 99vh; */
            flex-grow: 1;
            overflow-y: scroll;
            border-radius: 1px;
            border: #374151;
            border-style: solid;
        }

        .bottom-div {
            margin-top: 10px;
            /* height: 150px; */
            flex-grow: 0;
            width: 100%;
            overflow: visible;
            padding-right: 8px;
            padding-top: 5px;
            border: #374151;
            border-radius: 1px;
            border: #374151;
            border-style: solid;
            display: none;
            position: relative;
        }
        .closeX {
            color: #FFF;
            font: 14px/100% arial, sans-serif;
            position: absolute;
            top: 5px;
            right: 5px;
            text-decoration: none;
            text-shadow: 0 1px 0 #999;
            /*content: 'âœ–'; /* UTF-8 symbol */
            cursor: pointer;
        }

        .prompt-positive {
            color: #00FFFF;
        }
        .prompt-negative {
            color: #FF00FF;
        }
        .prompt-settings {
            color: #FFFF00;
        }
    
    </style>
</head>

<body>
    <div class="container">
        <div>
            <div class="andOrDiv">
                <span class="andOrButtonLabel">AND</span>
                <label class="switch">
                    <input type="checkbox" id="andor" onchange="updateImageBrowser()" checked />
                    <span class="slider round"></span>
                </label>
                <span class="andOrButtonLabel">OR</span>
            </div>
            <div class="left-column">
                <!-- First left div with checkboxes -->
                <h2 class="column-headers">Character search</h2>
                <label for="charSearch" class="searchLabel">Search:<input oninput="updateCharDiv()" id="charSearch"
                        class="searchBar" /></label>

                <ul id="characters"></ul>
            </div>
            <div class="left-column">
                <!-- Second left div with checkboxes -->
                <h2 class="column-headers">Tag search</h2>
                <label for="tagSearch" class="searchLabel">Search:<input oninput="updateTagDiv()" id="tagSearch"
                        class="searchBar" /></label>
                <ul id="tags"> </ul>
            </div>
        </div>
        <div class="topMainBrowser">
            <div class="main-div image-grid" id="browser"></div>
            <div class="bottom-div" id="prompt-info"></div>
        </div>
    </div>
</body>

    // Character List
    var characters = data["characters"];
    for (var characterName in characters) {
        var characterData = characters[characterName];

        // <li><input type="checkbox" id="checkbox3"> <label for="checkbox3">Checkbox 3</label></li>

        var label = document.createElement("label");
        label.htmlFor = "char" + characterName;
        label.appendChild(document.createTextNode(characterName + "(" + characterData.length + ")"));

        var newCheckbox = document.createElement("input");
        newCheckbox.type = "checkbox";
        newCheckbox.id = "char" + characterName;
        newCheckbox.value = characterData;
        newCheckbox.textContent = characterName;
        newCheckbox.setAttribute("onchange", "toggleCharacter(this)");
        label.append(newCheckbox);

        var li = document.createElement("li");
        li.id = characterName + "_li";
        li.classList.add("characterListItem");
        li.appendChild(label);

        document.getElementById("characters").appendChild(li);
    }

    // Tag List
    var allTags = data["tags"];
    for (var tag in allTags) {
        var label = document.createElement("label");
        label.htmlFor = tag;
        label.appendChild(document.createTextNode(tag + "(" + allTags[tag].length + ")"));

        var newCheckbox = document.createElement("input");
        newCheckbox.type = "checkbox";
        newCheckbox.id = "tag_" + tag;
        newCheckbox.value = allTags[tag];
        newCheckbox.textContent = tag;
        newCheckbox.setAttribute("onchange", "toggleTags(this)");

        label.appendChild(newCheckbox);

        var li = document.createElement("li");
        li.id = tag + "_li";
        li.classList.add("tagListItem");
        li.appendChild(label);

        document.getElementById("tags").appendChild(li);
    }
    // Image browser
    var images = data["images"];
    for (var imageId in images) {
        // var div = document.createElement('div');
        // div.id = imageId;

        var imageInfo = images[imageId];
        var imgPath = "./" + imageInfo["character"] + "/" + imageInfo["fileName"];

        var img = document.createElement("img");
        img.id = "img_" + imageId;
        img.setAttribute("src", imgPath);
        img.setAttribute("width", "200");
        img.setAttribute("height", "auto");
        img.setAttribute("loading", "lazy");
        img.setAttribute("onclick", "selectImage(this)");
        document.getElementById("browser").appendChild(img);

        // div.appendChild(img);
    }

    function selectImage(image) {
        var index = image.id.split("_")[1];
        console.log(index);

        imagePath = data["images"][index];

        // TODO: Pretyfy the prompt-info

        var jsonToDisplay = 
            "Character: " + imagePath["character"] + "<br>" +
            "Dimension: " + imagePath["width"] + "x" + imagePath["height"] + "<br>" +
            "File: " + imagePath["fileName"] + "<br>" +
            "Prompt: " + "<span class='prompt-positive'>" + imagePath["prompt"] + "</span>" + "<br>" +
            "Negative: " + "<span class='prompt-negative'>" + imagePath["negative"] + "</span>" + "<br>" +
            "Settings: " + "<span class='prompt-settings'>" + imagePath["settings"] + "</span>";

        document.getElementById("prompt-info").innerHTML = jsonToDisplay;
        document.getElementById("prompt-info").innerHTML += "<div class=\"closeX\" onclick=\"closePrompt()\">âœ–</div>";
        document.getElementById("prompt-info").style.display = "block";
    }

    function closePrompt() {
        document.getElementById("prompt-info").style.display = "none";
    }

    function toggleCharacter(checkbox) {
        updateImageBrowser();
    }

    function toggleTags(checkbox) {
        updateImageBrowser();
    }

    function updateCharDiv() {
        searchValue = document.getElementById("charSearch").value;
        for (item of document.getElementsByClassName("characterListItem")) {
            item.style.display = item.id.toLowerCase().split("_li")[0].includes(searchValue) ? "list-item" : "none";
        }
    }
    function updateTagDiv() {
        searchValue = document.getElementById("tagSearch").value;
        for (item of document.getElementsByClassName("tagListItem")) {
            item.style.display = item.id.toLowerCase().split("_li")[0].includes(searchValue) ? "list-item" : "none";
        }
    }

    function updateImageBrowser() {
        // Loop ALL checkboxes and compile a list of visible image IDs
        var IDsToDisplay = [];
        var ANDsearchStarted = false;
        var selectedCount = 0;

        // Loop all the checkboxes
        for (x = 0; x < document.getElementsByTagName("input").length; x++) {
            if (document.getElementsByTagName("input").item(x).type == "checkbox") {
                // Only care if its checked
                if (document.getElementsByTagName("input").item(x).id == "andor") {
                } else if (document.getElementsByTagName("input").item(x).checked) {
                    selectedCount++;

                    // change value into array
                    var values = document.getElementsByTagName("input").item(x).value.split(",");

                    // OR search: add all values to list
                    if (document.getElementById("andor").checked) {
                        for (index in values) {
                            var imgID = "img_" + values[index];
                            if (!IDsToDisplay.includes(imgID)) {
                                IDsToDisplay.push(imgID);
                            }
                        }
                    } else {
                        // AND search: intersect values and IDsToDisplay

                        // Small fix, prefix all element in list
                        values = values.map((el) => "img_" + el);

                        // First array, use them all!
                        if (IDsToDisplay.length == 0 && !ANDsearchStarted) {
                            IDsToDisplay = values;
                            ANDsearchStarted = true;
                        } else {
                            // Intersect arrays
                            IDsToDisplay = IDsToDisplay.filter((value) => values.includes(value));
                        }
                    }
                }
            }
        }

        // Loop all images
        var images = document.getElementsByTagName("img");
        for (i = 0; i < images.length; i++) {
            // Show/Hide parent div if id is in list
            var img = images[i];
            if (selectedCount > 0 && !IDsToDisplay.includes(img.id)) {
                img.style.display = "none";
            } else {
                img.style.display = "block";
            }
        }
    }
